class NavbarLogo extends Component {
  static contextType = PageData

  render(){
    let data = this.context.headers
    console.log(data.colormodes)


    return (
      <div className="navbar-logo">
        <Link href='/'>
          <a><BrandLogo colorMode={data.colormodes.close.foreground}/></a>
        </Link>
      </div>
    )
  }
}

